const Merriweather300 = `@font-face { font-family: 'Merriweather'; font-style: normal; font-weight: 300; src: local('Merriweather Light'), local('Merriweather-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const MerriweatherRegular = `@font-face { font-family: 'Merriweather'; font-style: normal; font-weight: 400; src: local('Merriweather Regular'), local('Merriweather-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const Merriweather300italic = `@font-face { font-family: 'Merriweather'; font-style: italic; font-weight: 300; src: local('Merriweather Light Italic'), local('Merriweather-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const MerriweatherItalic = `@font-face { font-family: 'Merriweather'; font-style: italic; font-weight: 400; src: local('Merriweather Italic'), local('Merriweather-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Merriweather700 = `@font-face { font-family: 'Merriweather'; font-style: normal; font-weight: 700; src: local('Merriweather Bold'), local('Merriweather-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Merriweather900 = `@font-face { font-family: 'Merriweather'; font-style: normal; font-weight: 900; src: local('Merriweather Black'), local('Merriweather-Black'), url('data:font/woff2;base64,') format('woff2'); }`;
